(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[8756],{18756:function(e){"use strict";e.exports=JSON.parse("{\"md\":\"# Core Data Containers\\n\\n## Introduction\\n\\nCore Data Containers are pre-defined Platform Data Containers that are provided by the Scale8 Platform. This is similar to the list of data layers provided by Google Tag Manager.\\n\\n## App State\\n\\nA simple data object used for tracking state changes. Actions can update this object with new data and conditions/exceptions can test variables data.\\n\\n## Custom Data Layer\\n\\nA custom defined publisher Data Layer\\n\\n## Element Click\\n\\nThe click data of the last clicked element\\n\\n### Configuration Properties\\n\\n| Property&nbsp;Name | Property&nbsp;Description | Var&nbsp;Type | Default&nbsp;Value | Is&nbsp;Required |\\n|---|---|---|---|---|\\n| id | The ID of the clicked element | STRING |  | Yes |\\n| attributes | A key / value list of the clicked element's attributes | OBJECT |  | Yes |\\n| classes | An array of CSS class names associated with the clicked element | ARRAY_STRING |  | Yes |\\n\\n## Environment Variables\\n\\nThese variables are public and defined when you are creating an environment. Environment variables can be updated or changed at any time via the UI\\n\\n## Last Error\\n\\nThe data of the last error caught in the browser\\n\\n### Configuration Properties\\n\\n| Property&nbsp;Name | Property&nbsp;Description | Var&nbsp;Type | Default&nbsp;Value | Is&nbsp;Required |\\n|---|---|---|---|---|\\n| file | The file name that the error was triggered from | STRING |  | Yes |\\n| message | The error message | STRING |  | Yes |\\n| line | The line number at which the error was triggered | INT |  | Yes |\\n| column | The column number at which the error was triggered | INT |  | Yes |\\n\\n## Local Storage\\n\\nThe browser's local storage\\n\\n## Query String\\n\\nThe query string as present in the browser's URL bar\\n\\n## Scale8 Browser Details\\n\\nA data layer describing all the accessible properties within the Scale8 core\\n\\n### Configuration Properties\\n\\n| Property&nbsp;Name | Property&nbsp;Description | Var&nbsp;Type | Default&nbsp;Value | Is&nbsp;Required |\\n|---|---|---|---|---|\\n| language | The current browser detected language in ISO Language Code format. e.g. en-GB, en-US, de-AT. | STRING |  | Yes |\\n| cookies_enabled | If the current browser supports cookies | STRING |  | Yes |\\n| is_online | If the current browser has an active internet connection | STRING |  | Yes |\\n| user_agent | The browser's user agent string, in full. | STRING |  | Yes |\"}")}}]);